import Layout from "./components/Layout";
import { Route, Routes } from "react-router-dom";
import Homepage from "./components/Homepage";

function App() {
  return (
    <Routes>
        <Route path="/" element ={ <Layout/>}>
          <Route path="/" element={<Homepage/>}/>
        </Route>
    </Routes>
  );
}

export default App;
